import React from "react";
import './nav.scss';
import {NavLink, Link} from 'react-router-dom'

class Nav extends React.Component{

    render(){
        return(
            <div className="topnav">
                <a className="active" href="/">Home</a>
                <a href="/todo">ToDos</a>
                <a href="/about">About</a>
            </div>
        )
    }

}

export default Nav
